import React from "react";
import FormPage from "components/form";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    state = {
      newTest: {
        layer: { defaultLayer },
        testType: { defaultTestType },
        testName: { defaultTestName },
        testDescription: { defaultTestDescription },
      },
      basicConfig: {
        target: { defaultTarget },
        protocol: { defaultProtocol },
        probing: { defaultProbing },
        pathTrace: { defaultPathTrace },
        interval: { defaultInterval },
        agents: { defaultAgents },
        alerts: { enable: { defaultEnable }, numRules: { defaultAlert } },
      },
    };
  }
  render() {
    const { newTest, basicConfig, advancedSett } = this.state;

    return (
      <FormPage
        newTest={newTest}
        basicConfig={basicConfig}
        advancedSett={advancedSett}
      />
    );
  }
}

export default App;
